import { Col, Row } from "react-bootstrap"

import Logoillo from './Images-image/Locally_logoillo.png'
import Socks from './Images-image/Locally_socks.png'

function Images(){
    const images = [{
        id: 1,
        bigImage: Logoillo,
        image1: Socks,
        image2: ''
    }]
    const imagesOnMap = images.map((image) => 
    <div key = "images.id">
        <img src = {images.bigImage} className="w-100"/>

        <Row>
            <Col lg = "6">{images.image1}</Col>
            <Col lg = "6">{images.image2}</Col>
        </Row>
    </div>
    )

    return(
        <div>
            {imagesOnMap}
        </div>
    )
}

export default Images
